sec.p:
For contrast, the DSSCs with the MoIn2S4, MoIn2S4@CNTs, and Pt CEs are prepared with the uniform photoanodes and electrolyte. The J-V characteristic curves are measured under 1 sun (AM 1.5 G, 100 mW cm−2) and the corresponding photovoltaic parameters values are listed in Table 3. Four key parameters including short-circuit current density (Jsc), open-circuit voltage (Voc), fill factor (FF), and power conversion efficiency (η) are usually adopted to assess the photovoltaic performance of the DSSCs. The FF and η of the DSSCs are calculated according to the Eqs. (1) and (2):
